==Geography== Tekmal is town near Jogipet located at {{Coord|17.97|N|78.04|E|}}.<ref>[http://www.fallingrain.com/world/IN/2/Tekmal.html Falling Rain Genomics, Inc - Medak]</ref> It has an average elevation of 455&nbsp;metres (1496&nbsp;feet).
